import React from "react";
import './ChanteuseComponent.css';
import Footer from '../Footer/Footer';
import { Link } from "react-router-dom";
import { MDBCard, MDBCardBody, MDBCol, MDBRow, MDBContainer, MDBCardTitle, MDBCardText } from "mdbreact";
import InfiniteCarousel from 'react-leaf-carousel';
import margotImg1 from '../img/margot-1.jpg';
import margotImg2 from '../img/margot-2.jpg';
import margotImg3 from '../img/margot-3.jpg';
import margotImg4 from '../img/margot-4.jpg';

const ChanteuseComponent = () => {
return (
  <div className="ChanteuseComponent">



  <InfiniteCarousel
    breakpoints={[
      {
        breakpoint: 500,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
        },
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
        },
      },
    ]}
    dots={true}
    showSides={true}
    sidesOpacity={.5}
    sideSize={.1}
    slidesToScroll={4}
    slidesToShow={4}
    scrollOnDevice={true}
  >
    <div>
      <img
        alt=''
        src={margotImg1}
      />
    </div>
    <div>
      <img
        alt=''
        src={margotImg2}
      />
    </div>
    <div>
      <img
        alt=''
        src={margotImg3}
      />
    </div>
    <div>
      <img
        alt=''
        src={margotImg4}
      />
    </div>

  </InfiniteCarousel>
    </div>
  )
};

export default ChanteuseComponent;
